--
--  "initialize" code for Mission16 Events FSM
--
function Init_Mission16_Events(TeamName)
	--FSM: FSM_Mission16_Events
	--TeamName = Events
	AssaultDead[TeamName] = 0 --created,set
	Subtitle_ForceEventNotEnded()    --kasfIntelEventNotEnded()
	--kasJump("LocationCard")
	KASRule_Add(TeamName, "Watch_Mission16_Events_LocationCard", "Init_Mission16_Events")
	Init_Mission16_Events_LocationCard(TeamName)
	return
	
end 


--
--  "watch" code for Mission16 Events FSM
--
function Watch_Mission16_Events(TeamName)
	--FSM: FSM_Mission16_Events
	--TeamName = Events
	if (_VIFONCE001[TeamName] == 0 and (1 ~= 0)) then  -- "ifonce" #1
	
	_VIFONCE001[TeamName] = 1 --created,set;
	KAS_SetMuteActor(2048, 0)    --kasfToggleActor(2048, 0)
	end 
	if (_VIFONCE002[TeamName] == 0 and (KAS_ShipHasBeenRendered("AssaultCruiser1", 3) ~= 0)) then  -- "ifonce" #2    --kasfRenderedShips(kasAITeamShipsPtr("AssaultCruiser1"), 3)
	
	_VIFONCE002[TeamName] = 1 --created,set;
	KAS_MusicPlayType("data:sound/music/battle/B04_EvilEmpire", MUS_Ambient)    --kasfMusicPlay(15)
	end 
	if (_VIFONCE003[TeamName] == 0 and ((G_Assaults == 2) or KAS_MessageReceived(TeamName, "BG2Attacking") ~= 0)) then  -- "ifonce" #3    --kasfMsgReceived("BG2Attacking")
	
	_VIFONCE003[TeamName] = 1 --created,set;
	KASTimer_Start(Defector[TeamName], RandomIntRange(30, 60))    --kasfRandom(30, 60)
	end 
	if (KASTimer_IsExpiredIfSoDestroy(Defector[TeamName]) ~= 0) then 
	
	KAS_MessageSendToAll(TeamName, "InComesDefector")    --kasfMsgSendAll("InComesDefector")
	KAS_MusicPlayType("data:sound/music/battle/A03_mission3", MUS_Ambient)    --kasfMusicPlay(11)
	--kasJump("Overwhelmed")
	--KASRule_Remove("FSM_Mission16_Events", "Watch_Mission16_Events")
	KASRule_Add(TeamName, "Watch_Mission16_Events_Overwhelmed", "Watch_Mission16_Events")
	Init_Mission16_Events_Overwhelmed(TeamName)
	return
	end 
	if (KAS_MessageReceived(TeamName, "BigWave") ~= 0) then     --kasfMsgReceived("BigWave")
	
	--kasJump("LBXIn3")
	--KASRule_Remove("FSM_Mission16_Events", "Watch_Mission16_Events")
	KASRule_Add(TeamName, "Watch_Mission16_Events_LBXIn3", "Watch_Mission16_Events")
	Init_Mission16_Events_LBXIn3(TeamName)
	return
	end 
	if (KAS_MessageReceived(TeamName, "EmperorDead") ~= 0) then     --kasfMsgReceived("EmperorDead")
	
	--kasJump("LBXIn2")
	--KASRule_Remove("FSM_Mission16_Events", "Watch_Mission16_Events")
	KASRule_Add(TeamName, "Watch_Mission16_Events_LBXIn2", "Watch_Mission16_Events")
	Init_Mission16_Events_LBXIn2(TeamName)
	return
	end 
	if (KAS_MessageReceived(TeamName, "AllAssaultDied") ~= 0) then     --kasfMsgReceived("AllAssaultDied")
	
	AssaultDead[TeamName] = AssaultDead[TeamName] + 1
	end 
	if (_VIFONCE004[TeamName] == 0 and (AssaultDead[TeamName] == 1)) then  -- "ifonce" #4
	
	_VIFONCE004[TeamName] = 1 --created,set;
	KAS_MusicStop(4)    --kasfMusicStop(4)
	end 
	if (_VIFONCE005[TeamName] == 0 and ((AssaultDead[TeamName] == 2) and (SobGroup_Count("BG1HeavyCruiser") == 0) and (SobGroup_Count("BG1Destroyer1") == 0) and (SobGroup_Count("BG1Destroyer2") == 0) and (SobGroup_Count("BG1Destroyer3") == 0) and (SobGroup_Count("BG1Frigates") == 0) and (SobGroup_Count("BG1IonFrigates") == 0) and (SobGroup_Count("BG2HeavyCruiser") == 0) and (SobGroup_Count("BG2Frigates") == 0) and (SobGroup_Count("BG2IonFrigates") == 0))) then  -- "ifonce" #5    --kasfShipsCount(kasAITeamShipsPtr("BG2IonFrigates"))    --kasfShipsCount(kasAITeamShipsPtr("BG2Frigates"))    --kasfShipsCount(kasAITeamShipsPtr("BG2HeavyCruiser"))    --kasfShipsCount(kasAITeamShipsPtr("BG1IonFrigates"))    --kasfShipsCount(kasAITeamShipsPtr("BG1Frigates"))    --kasfShipsCount(kasAITeamShipsPtr("BG1Destroyer3"))    --kasfShipsCount(kasAITeamShipsPtr("BG1Destroyer2"))    --kasfShipsCount(kasAITeamShipsPtr("BG1Destroyer1"))    --kasfShipsCount(kasAITeamShipsPtr("BG1HeavyCruiser"))
	
	_VIFONCE005[TeamName] = 1 --created,set;
	KAS_MusicStop(4)    --kasfMusicStop(4)
	--kasJump("LBXIn4")
	--KASRule_Remove("FSM_Mission16_Events", "Watch_Mission16_Events")
	KASRule_Add(TeamName, "Watch_Mission16_Events_LBXIn4", "Watch_Mission16_Events")
	Init_Mission16_Events_LBXIn4(TeamName)
	return
	end 
	if (SobGroup_Count("ImperialFlagship") ~= 0) then     --kasfShipsCount(kasAITeamShipsPtr("ImperialFlagship"))
	
	if (G_CLICK_Eradicate ~= 0) then 
	
	G_CLICK_Eradicate = 0 --destroyed
	Replay[TeamName] = 1 --created,set
	KAS_SensorsToggle(1, 100000)    --kasfOpenSensors(100000)
	KAS_UniversePause(1)    --kasfUniversePause()
	--kasJump("OhBoyHereWeGo")
	--KASRule_Remove("FSM_Mission16_Events", "Watch_Mission16_Events")
	KASRule_Add(TeamName, "Watch_Mission16_Events_OhBoyHereWeGo", "Watch_Mission16_Events")
	Init_Mission16_Events_OhBoyHereWeGo(TeamName)
	return
	elseif (G_CLICK_Flagship ~= 0) then 
	
	G_CLICK_Flagship = 0 --destroyed
	Replay[TeamName] = 1 --created,set
	KAS_SensorsToggle(1, 100000)    --kasfOpenSensors(100000)
	KAS_UniversePause(1)    --kasfUniversePause()
	--kasJump("HereIsMothership")
	--KASRule_Remove("FSM_Mission16_Events", "Watch_Mission16_Events")
	KASRule_Add(TeamName, "Watch_Mission16_Events_HereIsMothership", "Watch_Mission16_Events")
	Init_Mission16_Events_HereIsMothership(TeamName)
	return
	end 
	end 
	
end 


