--
--  "initialize" code for Mission16 AssaultGeneral MoveToMothership state
--
function Init_Mission16_AssaultGeneral_MoveToMothership(TeamName)
	--FSM: FSM_Mission16_AssaultGeneral
	--TeamName = "EliteHarrassIonFrigs"
	SobGroup_SetROE(TeamName, PassiveROE)    --kasfTacticsNeutral()
		SobGroup_SetStance(TeamName, AggressiveStance)
	if (G_AlreadyMoving == 0) then 
	
	if (KAS_TeamNamesEqual(TeamName, "EliteHarrassIonFrigs") ~= 0 and ignoredFunction(0) ~= 0) then     --kasfRaceOfHuman()    --kasfThisTeamIs(kasAITeamPtr("EliteHarrassIonFrigs"))
	
	SobGroup_MoveToPoint(SobGroup_GetPlayerOwner(TeamName), TeamName, Volume_GetPosition("KushanSBPoint"))    --kasfMoveTo(kasVectorPtr("KushanSBPoint"))
	else
	
	SobGroup_MoveToPoint(SobGroup_GetPlayerOwner(TeamName), TeamName, SobGroup_GetCentrePosition("GrowSelection_Mothership"))    --kasfMoveTo(kasShipsVectorPtr("Mothership"))
	end 
	else
	
	G_AlreadyMoving = G_AlreadyMoving - 1
	end 
	MovingToMothership[TeamName] = 1 --created,set
	
end 


--
--  "watch" code for Mission16 AssaultGeneral MoveToMothership state
--
function Watch_Mission16_AssaultGeneral_MoveToMothership(TeamName)
	--FSM: FSM_Mission16_AssaultGeneral
	--TeamName = "EliteHarrassIonFrigs"
	if (KAS_MessageReceived(TeamName, "Engage") ~= 0) then     --kasfMsgReceived("Engage")
	
	MovingToMothership[TeamName] = 0 --destroyed
	if (KAS_TeamNamesEqual(TeamName, "AssaultCruiser1") ~= 0) then     --kasfThisTeamIs(kasAITeamPtr("AssaultCruiser1"))
	
	G_Assaults = G_Assaults + 1
	end 
	SobGroup_SetROE(TeamName, OffensiveROE)    --kasfTacticsAggressive()
		SobGroup_SetStance(TeamName, AggressiveStance)
	--kasJump("PrioritizeAttack")
	--KASRule_Remove("FSM_Mission16_AssaultGeneral", "Watch_Mission16_AssaultGeneral_MoveToMothership")
	KASRule_Add(TeamName, "Watch_Mission16_AssaultGeneral_PrioritizeAttack", "Watch_Mission16_AssaultGeneral_MoveToMothership")
	Init_Mission16_AssaultGeneral_PrioritizeAttack(TeamName)
	return
	end 
	if (KAS_FindDistance(KAS_NamedCentrePosition(TeamName), KAS_NamedCentrePosition("GrowSelection_Mothership")) < 15000) then     --kasfFindDistance(kasThisTeamsVectorPtr(), kasShipsVectorPtr("Mothership"))
	
	CloseToMothership[TeamName] = 1 --created,set
	KAS_MessageSend(TeamName, TeamName, "Engage")    --kasfMsgSend(kasThisTeamPtr, "Engage")
	end 
	if (KAS_GetCurrentOrder(TeamName) ~= 1) then     --kasfShipsOrder((&kasThisTeamPtr->shipList))
	
	SobGroup_MoveToPoint(SobGroup_GetPlayerOwner(TeamName), TeamName, SobGroup_GetCentrePosition("GrowSelection_Mothership"))    --kasfMoveTo(kasShipsVectorPtr("Mothership"))
	end 
	
end 


