	KAS_SetFormation(TeamName, "Claw")    --kasfFormationClaw()
	elseif (RandomIntRange(0, 1) ~= 0) then     --kasfRandom(0, 1)
	
	KAS_SetFormation(TeamName, "Wall")    --kasfFormationWall()
