	KAS_ShipsAdd("GrowSelection_EliteHarrassBaddies", "GrowSelection_Mothership")    --kasfShipsAdd(kasGrowSelectionPtr("EliteHarrassBaddies"), kasGrowSelectionPtr("Mothership"))
