function Watch_Mission16_Master(TeamName)
	--FSM: FSM_Mission16_Master
	--TeamName = "ImperialFlagship"
	if (KASTimer_IsExpiredIfSoDestroy(TimerBattleGroup1[TeamName]) ~= 0) then 
	
	KAS_MessageSend(TeamName, "BG1HeavyCruiser", "ReleaseBattleGroup1")    --kasfMsgSend(kasAITeamPtr("BG1HeavyCruiser"), "ReleaseBattleGroup1")
	KAS_MessageSend(TeamName, "BG1Destroyer1", "ReleaseBattleGroup1")    --kasfMsgSend(kasAITeamPtr("BG1Destroyer1"), "ReleaseBattleGroup1")
	KAS_MessageSend(TeamName, "BG1Destroyer2", "ReleaseBattleGroup1")    --kasfMsgSend(kasAITeamPtr("BG1Destroyer2"), "ReleaseBattleGroup1")
	KAS_MessageSend(TeamName, "BG1Destroyer3", "ReleaseBattleGroup1")    --kasfMsgSend(kasAITeamPtr("BG1Destroyer3"), "ReleaseBattleGroup1")
	KAS_MessageSend(TeamName, "BG1Frigates", "ReleaseBattleGroup1")    --kasfMsgSend(kasAITeamPtr("BG1Frigates"), "ReleaseBattleGroup1")
	KAS_MessageSend(TeamName, "BG1IonFrigates", "ReleaseBattleGroup1")    --kasfMsgSend(kasAITeamPtr("BG1IonFrigates"), "ReleaseBattleGroup1")
	
	KAS_MessageSend(TeamName, "Events", "BigWave")    --kasfMsgSend(kasAITeamPtr("Events"), "BigWave")
	BattleGroup1Attacking[TeamName] = 1 --created,set
	KAS_ShipsAdd("GrowSelection_Reinforcements", "BG1HeavyCruiser")    --kasfShipsAdd(kasGrowSelectionPtr("Reinforcements"), kasAITeamShipsPtr("BG1HeavyCruiser"))
	end 
	if (KASTimer_IsExpiredIfSoDestroy(TimerBattleGroup2[TeamName]) ~= 0) then 
	
	KAS_MessageSend(TeamName, "BG2HeavyCruiser", "ReleaseBattleGroup2")    --kasfMsgSend(kasAITeamPtr("BG2HeavyCruiser"), "ReleaseBattleGroup2")
	KAS_MessageSend(TeamName, "BG2Frigates", "ReleaseBattleGroup2")    --kasfMsgSend(kasAITeamPtr("BG2Frigates"), "ReleaseBattleGroup2")
	KAS_MessageSend(TeamName, "BG2IonFrigates", "ReleaseBattleGroup2")    --kasfMsgSend(kasAITeamPtr("BG2IonFrigates"), "ReleaseBattleGroup2")
	
	KAS_MessageSend(TeamName, "Events", "BigWave")    --kasfMsgSend(kasAITeamPtr("Events"), "BigWave")
	BattleGroup2Attacking[TeamName] = 1 --created,set
	SobGroup_Clear("GrowSelection_Reinforcements")    --kasfGrowSelectionClear(kasGrowSelectionPtr("Reinforcements"))
	KAS_ShipsAdd("GrowSelection_Reinforcements", "BG2IonFrigates")    --kasfShipsAdd(kasGrowSelectionPtr("Reinforcements"), kasAITeamShipsPtr("BG2IonFrigates"))
	end 
	if (KASTimer_IsExpiredIfSoDestroy(TimerAssaultGroup[TeamName]) ~= 0) then 
	
	G_FormPoint = RandomIntRange(1, 5) --created,set    --kasfRandom(1, 5)
	KAS_MessageSendToAll(TeamName, "ReleaseAssaultGroup")    --kasfMsgSendAll("ReleaseAssaultGroup")
	AssaultGroupMoving[TeamName] = 1 --created,set
	end 
	if (KAS_MessageReceived(TeamName, "AssaultDead") ~= 0) then     --kasfMsgReceived("AssaultDead")
	
	AssaultDead[TeamName] = AssaultDead[TeamName] + 1
	--kasFSMCreate("AssaultTeam")
	KASRule_AddFSM("MsgSender", "Watch_Mission16_AssaultTeam", "Watch_Mission16_Master")
	Init_Mission16_AssaultTeam("MsgSender")
	end 
	if (AssaultDead[TeamName] == 7) then 
	
	AssaultDead[TeamName] = 0 --set
	KAS_MessageSend(TeamName, "Events", "AllAssaultDied")    --kasfMsgSend(kasAITeamPtr("Events"), "AllAssaultDied")
	end 
	if (KAS_MessageReceived(TeamName, "HonourDead") ~= 0) then     --kasfMsgReceived("HonourDead")
	
	HonourDead[TeamName] = HonourDead[TeamName] + 1
	end 
	if (KAS_MessageReceived(TeamName, "AssaultReplenished") ~= 0) then     --kasfMsgReceived("AssaultReplenished")
	
	AssaultReplenished[TeamName] = AssaultReplenished[TeamName] + 1
	end 
	if (_VIFONCE022[TeamName] == 0 and (KAS_TeamHealthLowest(TeamName) < 95)) then  -- "ifonce" #22    --kasfTeamHealthLowest()
	
	_VIFONCE022[TeamName] = 1 --created,set;
	KAS_MessageSend(TeamName, "SuicideFighters1", "Takeout")    --kasfMsgSend(kasAITeamPtr("SuicideFighters1"), "Takeout")
	end 
	if (_VIFONCE023[TeamName] == 0 and (KAS_TeamHealthLowest(TeamName) < 75)) then  -- "ifonce" #23    --kasfTeamHealthLowest()
	
	_VIFONCE023[TeamName] = 1 --created,set;
	KAS_MessageSend(TeamName, "SuicideFighters2", "Takeout")    --kasfMsgSend(kasAITeamPtr("SuicideFighters2"), "Takeout")
	end 
	if (_VIFONCE024[TeamName] == 0 and (KAS_TeamHealthLowest(TeamName) < 50)) then  -- "ifonce" #24    --kasfTeamHealthLowest()
	
	_VIFONCE024[TeamName] = 1 --created,set;
	KAS_MessageSend(TeamName, "SuicideFighters3", "Takeout")    --kasfMsgSend(kasAITeamPtr("SuicideFighters3"), "Takeout")
	end 
	if (_VIFONCE025[TeamName] == 0 and (KAS_TeamHealthLowest(TeamName) < 35)) then  -- "ifonce" #25    --kasfTeamHealthLowest()
	
	_VIFONCE025[TeamName] = 1 --created,set;
	KAS_MessageSend(TeamName, "SuicideFighters4", "Takeout")    --kasfMsgSend(kasAITeamPtr("SuicideFighters4"), "Takeout")
	end 
	if (_VIFONCE026[TeamName] == 0 and (SobGroup_Count(TeamName) == 0)) then  -- "ifonce" #26    --kasfTeamCount()
	
	_VIFONCE026[TeamName] = 1 --created,set;
	KAS_MessageSend(TeamName, "Events", "EmperorDead")    --kasfMsgSend(kasAITeamPtr("Events"), "EmperorDead")
	--kasJump("NullState")
	--KASRule_Remove("FSM_Mission16_Master", "Watch_Mission16_Master")
	KASRule_Add(TeamName, "Watch_Mission16_Master_NullState", "Watch_Mission16_Master")
	Init_Mission16_Master_NullState(TeamName)
	return
	end 
	
end 


