--
function Watch_Mission16_Master_Decreeing(TeamName)
	--FSM: FSM_Mission16_Master
	--TeamName = "ImperialFlagship"
	if (BG1Delay[TeamName] == 0 and BattleGroup1Attacking[TeamName] ~= 0 and KAS_FindEnemiesInside("BattleFleet1Checker", "GrowSelection_BG1Baddies") ~= 0) then     --kasfFindEnemiesInside(kasVolumePtr("BattleFleet1Checker"), kasGrowSelectionPtr("BG1Baddies"), 5000)
	
	--kasJump("AnalyseBG1Baddies")
	--KASRule_Remove("FSM_Mission16_Master", "Watch_Mission16_Master_Decreeing")
	KASRule_Add(TeamName, "Watch_Mission16_Master_AnalyseBG1Baddies", "Watch_Mission16_Master_Decreeing")
	Init_Mission16_Master_AnalyseBG1Baddies(TeamName)
	return
	end 
	if (BG2Delay[TeamName] == 0 and BattleGroup2Attacking[TeamName] ~= 0 and KAS_FindEnemiesInside("BattleFleet2Checker", "GrowSelection_BG2Baddies") ~= 0) then     --kasfFindEnemiesInside(kasVolumePtr("BattleFleet2Checker"), kasGrowSelectionPtr("BG2Baddies"), 5000)
	
	--kasJump("AnalyseBG2Baddies")
	--KASRule_Remove("FSM_Mission16_Master", "Watch_Mission16_Master_Decreeing")
	KASRule_Add(TeamName, "Watch_Mission16_Master_AnalyseBG2Baddies", "Watch_Mission16_Master_Decreeing")
	Init_Mission16_Master_AnalyseBG2Baddies(TeamName)
	return
	end 
	if (AssaultDelay[TeamName] == 0 and KAS_FindEnemiesInside("AssaultFleetChecker", "GrowSelection_AssaultBaddies") ~= 0) then     --kasfFindEnemiesInside(kasVolumePtr("AssaultFleetChecker"), kasGrowSelectionPtr("AssaultBaddies"), 5000)
	
	--kasJump("AnalyseAssaultBaddies")
	--KASRule_Remove("FSM_Mission16_Master", "Watch_Mission16_Master_Decreeing")
	KASRule_Add(TeamName, "Watch_Mission16_Master_AnalyseAssaultBaddies", "Watch_Mission16_Master_Decreeing")
	Init_Mission16_Master_AnalyseAssaultBaddies(TeamName)
	return
	end 
	if (RearDelay[TeamName] == 0 and (KAS_FindEnemiesInside("RearFleetChecker", "GrowSelection_RearBaddies") ~= 0 or G_DefectorInRearVol ~= 0)) then     --kasfFindEnemiesInside(kasVolumePtr("RearFleetChecker"), kasGrowSelectionPtr("RearBaddies"), 5000)
	
	if (G_DefectorInRearVol ~= 0) then 
	
	KAS_ShipsAdd("GrowSelection_RearBaddies", "DefectorDestroyer")    --kasfShipsAdd(kasGrowSelectionPtr("RearBaddies"), kasAITeamShipsPtr("DefectorDestroyer"))
	KAS_ShipsAdd("GrowSelection_RearBaddies", "DefectorIonFrigs")    --kasfShipsAdd(kasGrowSelectionPtr("RearBaddies"), kasAITeamShipsPtr("DefectorIonFrigs"))
	end 
	--kasJump("AnalyseRearBaddies")
	--KASRule_Remove("FSM_Mission16_Master", "Watch_Mission16_Master_Decreeing")
	KASRule_Add(TeamName, "Watch_Mission16_Master_AnalyseRearBaddies", "Watch_Mission16_Master_Decreeing")
	Init_Mission16_Master_AnalyseRearBaddies(TeamName)
	return
	end 
	if (SBDustDelay[TeamName] == 0 and KAS_FindEnemiesInside("SBDustChecker", "GrowSelection_SBDustBaddies") ~= 0) then     --kasfFindEnemiesInside(kasVolumePtr("SBDustChecker"), kasGrowSelectionPtr("SBDustBaddies"), 5000)
	
	--kasJump("AnalyseSBDustBaddies")
	--KASRule_Remove("FSM_Mission16_Master", "Watch_Mission16_Master_Decreeing")
	KASRule_Add(TeamName, "Watch_Mission16_Master_AnalyseSBDustBaddies", "Watch_Mission16_Master_Decreeing")
	Init_Mission16_Master_AnalyseSBDustBaddies(TeamName)
	return
	end 
	if (PortDustDelay[TeamName] == 0 and KAS_FindEnemiesInside("PortDustChecker", "GrowSelection_PortDustBaddies") ~= 0) then     --kasfFindEnemiesInside(kasVolumePtr("PortDustChecker"), kasGrowSelectionPtr("PortDustBaddies"), 5000)
	
	--kasJump("AnalysePortDustBaddies")
	--KASRule_Remove("FSM_Mission16_Master", "Watch_Mission16_Master_Decreeing")
	KASRule_Add(TeamName, "Watch_Mission16_Master_AnalysePortDustBaddies", "Watch_Mission16_Master_Decreeing")
	Init_Mission16_Master_AnalysePortDustBaddies(TeamName)
	return
	end 
	if (KAS_MessageReceived(TeamName, "BG1InPosition") ~= 0) then     --kasfMsgReceived("BG1InPosition")
	
	FormBG1[TeamName] = FormBG1[TeamName] + 1
	end 
	if (FormBG1[TeamName] == 6) then 
	
	--kasJump("FormUpBG1")
	--KASRule_Remove("FSM_Mission16_Master", "Watch_Mission16_Master_Decreeing")
	KASRule_Add(TeamName, "Watch_Mission16_Master_FormUpBG1", "Watch_Mission16_Master_Decreeing")
	Init_Mission16_Master_FormUpBG1(TeamName)
	return
	end 
	if (KAS_MessageReceived(TeamName, "BG2InPosition") ~= 0) then     --kasfMsgReceived("BG2InPosition")
	
	FormBG2[TeamName] = FormBG2[TeamName] + 1
	end 
	if (FormBG2[TeamName] == 4) then 
	
	--kasJump("FormUpBG2")
	--KASRule_Remove("FSM_Mission16_Master", "Watch_Mission16_Master_Decreeing")
	KASRule_Add(TeamName, "Watch_Mission16_Master_FormUpBG2", "Watch_Mission16_Master_Decreeing")
	Init_Mission16_Master_FormUpBG2(TeamName)
	return
	end 
	if (KAS_MessageReceived(TeamName, "AssaultInPosition") ~= 0) then     --kasfMsgReceived("AssaultInPosition")
	
	FormAssault[TeamName] = FormAssault[TeamName] + 1
	end 
	if (FormAssault[TeamName] == (7 - AssaultDead[TeamName])) then 
	
	--kasJump("FormUpAssault")
	--KASRule_Remove("FSM_Mission16_Master", "Watch_Mission16_Master_Decreeing")
	KASRule_Add(TeamName, "Watch_Mission16_Master_FormUpAssault", "Watch_Mission16_Master_Decreeing")
	Init_Mission16_Master_FormUpAssault(TeamName)
	return
	end 
	if (BG1Delay[TeamName] ~= 0) then 
	
	BG1Delay[TeamName] = BG1Delay[TeamName] - 1
	end 
	if (BG2Delay[TeamName] ~= 0) then 
	
	BG2Delay[TeamName] = BG2Delay[TeamName] - 1
	end 
	if (AssaultDelay[TeamName] ~= 0) then 
	
	AssaultDelay[TeamName] = AssaultDelay[TeamName] - 1
	end 
	if (RearDelay[TeamName] ~= 0) then 
	
	RearDelay[TeamName] = RearDelay[TeamName] - 1
	end 
	if (SBDustDelay[TeamName] ~= 0) then 
	
	SBDustDelay[TeamName] = SBDustDelay[TeamName] - 1
	end 
	if (PortDustDelay[TeamName] ~= 0) then 
	
	PortDustDelay[TeamName] = PortDustDelay[TeamName] - 1
	end 
	if ((AssaultReplenished[TeamName] == 7) and (AssaultBusy[TeamName] == 0)) then 
	
	AssaultReplenished[TeamName] = 0 --set
	KASTimer_Start(TimerAssaultGroup[TeamName], 5)
	end 
	
end 


