--
--  "watch" code for Mission16 mission
--
function Watch_Mission16(MissionName)
	--FSM: FSM_Mission16
	--MissionName = "Mission16"
	if (_VIFONCE027 == 0 and (1 ~= 0)) then  -- "ifonce" #27
	
	_VIFONCE027 = 1 --created,set;
	KAS_HW1CPUDisableAllAIFeatures()    --kasfDisableAllAIFeatures()
    --
    -- lmch: These features invokations appear to be backwards - setting to what the desingners' intent probably was
    --
	--kasfEnableAIFeature(0, 2)
	--kasfEnableAIFeature(0, 4)
	--kasfEnableAIFeature(0, 4096)
	--kasfEnableAIFeature(1, 256)
	--kasfEnableAIFeature(1, 512)
	--kasfEnableAIFeature(2, 2)
	--kasfEnableAIFeature(3, 1)
	--kasfEnableAIFeature(3, 2)
	KAS_HW1CPUEnableAIFeature(2, 0)    --kasfEnableAIFeature(2, 0)
	KAS_HW1CPUEnableAIFeature(4, 0)    --kasfEnableAIFeature(4, 0)
	KAS_HW1CPUEnableAIFeature(4096, 0)    --kasfEnableAIFeature(4096, 0)
	KAS_HW1CPUEnableAIFeature(256, 1)    --kasfEnableAIFeature(256, 1)
	KAS_HW1CPUEnableAIFeature(512, 1)    --kasfEnableAIFeature(512, 1)
	KAS_HW1CPUEnableAIFeature(2, 2)    --kasfEnableAIFeature(2, 2)
	KAS_HW1CPUEnableAIFeature(1, 3)    --kasfEnableAIFeature(1, 3)
	KAS_HW1CPUEnableAIFeature(2, 3)    --kasfEnableAIFeature(2, 3)
	end 
	KAS_FindPlayerShipsOfType("GrowSelection_Mothership", "Mothership", 0)    --kasfFindEnemyShipsOfType(kasGrowSelectionPtr("Mothership"), "Mothership")
	KAS_ShipsAdd("GrowSelection_MothershipSurrounding", "GrowSelection_Mothership")    --kasfShipsAdd(kasGrowSelectionPtr("MothershipSurrounding"), kasGrowSelectionPtr("Mothership"))
	KAS_FindEnemiesNearby("GrowSelection_MothershipSurroundingD", 7000)    --kasfFindEnemiesNearby(kasGrowSelectionPtr("MothershipSurroundingD"), 20000)
	KAS_FindEnemiesInside("AssaultFleetChecker", "GrowSelection_AssaultFleetVol")    --kasfFindEnemiesInside(kasVolumePtr("AssaultFleetChecker"), kasGrowSelectionPtr("AssaultFleetVol"), 5000)
	KAS_FindEnemiesInside("BattleFleet1Checker", "GrowSelection_BattleFleet1Vol")    --kasfFindEnemiesInside(kasVolumePtr("BattleFleet1Checker"), kasGrowSelectionPtr("BattleFleet1Vol"), 5000)
	KAS_FindEnemiesInside("BattleFleet2Checker", "GrowSelection_BattleFleet2Vol")    --kasfFindEnemiesInside(kasVolumePtr("BattleFleet2Checker"), kasGrowSelectionPtr("BattleFleet2Vol"), 5000)
	KAS_FindEnemiesInside("RearFleetChecker", "GrowSelection_RearFleetVol")    --kasfFindEnemiesInside(kasVolumePtr("RearFleetChecker"), kasGrowSelectionPtr("RearFleetVol"), 5000)
	if ((KAS_PlayerHasResearch(0, "FighterDrive") ~= 0) and (SetTechOnce1 == 0)) then     --kasfDoesPlayerHave("MassDrive1Kt")
	
	KAS_UnrestrictResearchOption(0, "FighterChassis")    --kasfAllowPlayerToResearch("Chassis1")
	SetTechOnce1 = 1 --created,set
	end 
	if ((KAS_PlayerHasResearch(0, "CorvetteDrive") ~= 0) and (SetTechOnce2 == 0)) then     --kasfDoesPlayerHave("MassDrive10Kt")
	
	KAS_UnrestrictResearchOption(0, "CorvetteChassis")    --kasfAllowPlayerToResearch("Chassis2")
	SetTechOnce2 = 1 --created,set
	end 
	if ((KAS_PlayerHasResearch(0, "CapitalShipDrive") ~= 0) and (SetCapitalChassis == 0)) then     --kasfDoesPlayerHave("MassDrive100Kt")
	
	KAS_UnrestrictResearchOption(0, "CapitalShipChassis")    --kasfAllowPlayerToResearch("Chassis3")
	SetCapitalChassis = 1 --set
	end 
	if ((KAS_PlayerHasResearch(0, "CorvetteChassis") ~= 0) and (SetMediumGuns == 0)) then     --kasfDoesPlayerHave("Chassis2")
	
	KAS_UnrestrictResearchOption(0, "HeavyCorvetteUpgrade")    --kasfAllowPlayerToResearch("MediumGuns")
	SetMediumGuns = 1 --created,set
	end 
	
end 

